"Verbinden",CONNECTION_STATUS_AUTHENTICATING:"Aan het identificeren",CONNECTION_STATUS_AWAITING_ENDPOINT:"Eindpunt Afwachten",CONNECTION_STATUS_DISCONNECTED:"Niet verbonden",CONNECTION_STATUS_VOICE_CONNECTED:"Spraak verbonden",CONNECTION_STATUS_VIDEO_CONNECTED:"Video verbonden",CONNECTION_STATUS_RTC_CONNECTING:"",CONNECTION_STATUS_ICE_CHECKING:"ICE-controle",CONNECTION_STATUS_NO_ROUTE:"Geen route",CONNECTION_STATUS_RTC_DISCONNECTED:"RTC-verbinding verbroken",IP_ADDRESS_SECURED:"IP-adres beveiligd",DEBUG:"Debuggen",DISCONNECT:"",RTC_CONNECTION_INFO:"",RTC_CONNECTION:"",RTC_CONNECTION_STATE_AWAITING_ENDPOINT:"",RTC_CONNECTION_STATE_CONNECTING:"",RTC_CONNECTION_STATE_AUTHENTICATING:"",RTC_CONNECTION_STATE_RTC_CONNECTING:"",RTC_CONNECTION_STATE_ICE_CHECKING:"Sta klaar! Discord heeft een beveiligde verbinding gemaakt met je real-time communicatieserver en probeert data te versturen.\nAls je browserverbinding vastloopt, bekijk dan [dit mooie artikel]({url}) om het probleem te verhelpen.",RTC_CONNECTION_STATE_NO_ROUTE:"",RTC_CONNECTION_STATE_RTC_CONNECTED:"",RTC_CONNECTION_STATE_RTC_CONNECTED_LOSS_RATE:"",RTC_CONNECTION_STATE_DISCONNECTED:"De hamsters zijn mogelijk uit het rad gevallen. De verbinding tussen Discord en jouw server is verbroken.\nWe proberen de verbinding te herstellen, even geduld.",TUTORIAL_SKIP:"Heb je al ervaring? [Sla de tips over](onSkipClick)",TUTORIAL_CLOSE:"Begrepen!",CHANNEL_MUTE_TOOLTIP:"Een kanaal dempen zorgt ervoor dat meldingen en indicatoren voor ongelezen berichten alleen verschijnen wanneer je wordt geroepen.",SHOW_MUTED:"Toon {n} gedempte kanalen",HIDE_MUTED:"Verberg {n} gedempte kanalen",WELCOME_MESSAGE_OWNER_TITLE:"Welkom op jouw server, !!{username}!!!",WELCOME_MESSAGE_TITLE:"",WELCOME_MESSAGE_INSTANT_INVITE:"**Nodig je vrienden uit** voor deze server door op een [deelknop](onShareClick) te klikken.",WELCOME_MESSAGE_DESKTOP_APPS:"**Download** de [desktopapplicatie](onDownloadClick) voor push-to-talk-toegang, lager CPU- en bandbreedteverbruik en meer.",WELCOME_MESSAGE_TUTORIAL:"**Leer meer over Discord** door op je eigen tempo op de uitroeptekens te klikken.",WELCOME_MESSAGE_MOBILE_APPS:"**Blijf met je server verbonden** vanaf [je smartphone](onDownloadClick) en gebruik Discord zelfs tijdens het spelen op een console.",WELCOME_MESSAGE_SUPPORT:"**Bereik ons** via [onze helpdesk]({supportURL}) of op Twitter [@discordapp]({twitterURL}) als je met een vraag zit of hulp nodig hebt.",TIP_VOICE_CONVERSATIONS_TITLE:"Laat van je horen",TIP_VOICE_CONVERSATIONS_BODY:"Dit is je **spraak-configuratiescherm**.\n\nGebruik deze knoppen om je microfoon of koptelefoon te dempen of instellingen aan te passen. Je kunt je spraakmodus aanpassen van **spraakactivatie naar push-to-talk** door op het tandwiel te klikken.",TIP_WRITING_MESSAGES_TITLE:"Start een gesprek",TIP_WRITING_MESSAGES_BODY:"Hier kun je al je meningen en ideeën kwijt.\n\nWe hebben ondersteuning voor markdownsyntax toegevoegd zodat je **jezelf duidelijk kunt maken** of __met je voeten kunt stampen__. Je kunt ook afbeeldingen en bestanden **hierheen slepen** om snel kattenanimaties te delen. Maar probeer je wel in te houden.",TIP_ORGANIZE_BY_TOPIC_TITLE:"Gebruik meerdere Kanalen",TIP_ORGANIZE_BY_TOPIC_BODY:"Met **tekstkanalen** kun je gesprekken opdelen per onderwerp. Je kunt gemakkelijk wisselen tussen kanalen en je vrienden **@vermelden** om een notificatie naar hun desktop of telefoon te sturen.\n\nMet **spraakkanalen** kun je met kleine of grote groepen praten.\nKlik op een kanaal om deel te nemen aan het gesprek. Zelfs als je van tekstkanaal wisselt, blijf je in het spraakkanaal!",TIP_WHOS_ONLINE_TITLE:"Wat ben je aan het spelen?",TIP_WHOS_ONLINE_BODY:"Deze lijst laat zien wie er in het huidige kanaal zitten.\n\nVan iedereen die de desktop-app gebruikt kun je zien welk spel ze nu spelen. Als je op een gebruiker klikt zie je de **individuele instellingen** zoals volume en admin-instellingen.",TIP_INSTANT_INVITE_TITLE:"Nodig je vrienden uit",TIP_INSTANT_INVITE_BODY:"Houd je muis over welk tekst- of spraakkanaal dan ook om de deelknop weer te geven. Gebruik de gegenereerde koppeling om mensen direct uit te nodigen voor het gekozen kanaal.\n\nGeavanceerde uitnodigingslinks geven je de mogelijkheid om gebruikslimieten in te stellen, zoals hoeveel mensen kunnen verbinden met die koppeling of hoe lang de koppeling werkt.",TIP_SERVER_SETTINGS_TITLE:"Beheer je server",TIP_SERVER_SETTINGS_BODY:"Klik hier om de serverinstellingen te openen.\n\nJe kunt allerlei dingen aanpassen zoals rechten en rollen, je serverregio kiezen, een AFK-kanaal opzetten, uitnodigingen beheren, verbannen gebruikers beheren of zelfs je server helemaal verwijderen.",TIP_DIRECT_MESSAGES_TITLE:"Begin een privégesprek",TIP_DIRECT_MESSAGES_BODY:"Bekijk alle leden van al je servers via deze lijst. \n\nJe kunt een privégesprek beginnen door een vriend te selecteren. Persoonlijke berichten zijn ideaal om mensen te bereiken via notificaties als ze eventjes weg zijn.",TIP_CREATE_MORE_SERVERS_TITLE:"Overal servers!",TIP_CREATE_MORE_SERVERS_BODY:"Klik op deze plusknop om een nieuwe server aan te maken.\n\nOmdat servers gratis zijn, kun je er zo veel maken als je zelf wilt. Elke server geeft je een unieke plek om met verschillende groepen mensen samen te komen. Je kunt servers ook verwijderen als je ze niet meer nodig hebt.",TIP_CREATE_FIRST_SERVER_TITLE:"Maak je eigen server aan",TIP_CREATE_FIRST_SERVER_BODY:"Klik op deze plusknop om je eigen server aan te maken.\n\nOmdat servers gratis zijn, kun je er zo veel maken als je zelf wilt. Elke server geeft je een unieke plek om met verschillende groepen mensen samen te komen. Je kunt servers ook verwijderen als je ze niet meer nodig hebt.",TIP_FRIENDS_LIST_TITLE:"Bekijk je vrienden",TIP_FRIENDS_LIST_BODY:"Klik hier om je persoonlijke berichten te bekijken en de status van iedereen in al je servers te zien.\n\nAls je een persoonlijk bericht ontvangt zal deze verschijnen naast je profielafbeelding zodat je het bericht eenvoudig kunt openen.",BAN_USER_TITLE:"",BAN_USER_CONFIRMED:"",BAN_CONFIRM_TITLE:"Gooi de Ban Hammer op !!{username}!!",FORM_LABEL_DELETE_MESSAGE_HISTORY:"Berichtgeschiedenis verwijderen",FORM_LABEL_REASON_KICK:"",FORM_LABEL_REASON_BAN:"",FORM_PLACEHOLDER_REASON:"",DELETE_MESSAGE_HISTORY_OPTION_NONE:"Niets verwijderen",DELETE_MESSAGE_HISTORY_OPTION_24HR:"Afgelopen 24 uur",DELETE_MESSAGE_HISTORY_OPTION_7D:"Afgelopen 7 dagen",NO_TEXT:"Nee",YES_TEXT:"Ja",CLOSE:"Sluiten",SEND:"Verzenden",CHOOSE:"Kies",SAVE:"Opslaan",SELECT:"Selecteren",START:"",ADD:"Voeg toe",NEXT:"",DEVICE_SETTINGS:"Apparaatinstellingen",ACTIONS:"",SAVE_CONTENT_SUCCESS_MOBILE:"Inhoud opgeslagen!",SAVE_CONTENT_FAILURE_MOBILE:"Het lukte niet om de inhoud op te slaan...",SAVE_CONTENT_FAILURE_HELP_MOBILE:"Controleer alsjeblieft de netwerk- en privacyinstellingen van je systeem voor de Foto's-app.",NO_CAMERA_ACCESS:"Discord heeft geen toegang tot je camera",NO_PHOTOS_ACCESS:"Discord heeft geen toegang tot je foto's",ENABLE_PRIVACY_ACCESS:"Je kunt toegang geven in de privacy-instellingen.",NO_PHOTO_IN_CAMERA_ROLL:"Geen foto's in de fotogalerij",PIN_MESSAGE_BODY_MOBILE:"Weet je zeker dat je dit bericht wil pinnen?",JOIN_VOICE_CHANNEL:"Verbinden met dit spraakkanaal?",LEAVE_SERVER_BODY_MOBILE:"",KICK_USER_TITLE:"",KICK_USER_BODY:"Weet je zeker dat je !!{user}!! wilt verwijderen? Deze gebruiker kan weer deelnemen aan de server via een nieuwe uitnodiging.",KICK_USER_CONFIRMED:"'!!{user}!!' is verwijderd van de server.",KICK_USER_ERROR_GENERIC:"Oeps... !!{user}!! kon niet worden verwijderd.  Probeer het nog eens!",BAN_USER_BODY:"",BAN_USER_ERROR_GENERIC:"Oeps... !!{user}!! kon niet worden verbannen.  Probeer het nog eens!",VOICE_DISCONNECT_TITLE:"Spraakverbinding verbreken",VOICE_DISCONNECT_BODY:"Verbinding met deze spraakserver verbreken?",JOIN_AFK_CHANNEL_BODY:"Je bent in het AFK-kanaal gaan zitten. Je kunt in dit kanaal niet spreken.",TAKE_PHOTO_OR_VIDEO:"",CAMERA_ROLL:"Fotogalerij",IMAGE:"Afbeelding",VID